import React from 'react';
import { Box, Link, Flex, Text } from '@chakra-ui/react';

const StayMenuItem = ({ children, isLast, to = "/", ...rest }) => {
  return (
    <Link href={to}>
      <Text display="block" {...rest}>
        {children}
      </Text>
    </Link>
  );
};

const Stay = () => {
  return (
    <><Card
          height="60px"
          padding="20px 10px"
          background='rgba(255,255,255, 0.3)'
          margin="5px"
          // cursor="pointer"
          justifyContent="center">
          <Flex justifyContent="space-between" width="100%" padding="10px">
              <Text fontSize="20px">
                  {member ? `Member${id + 1}:  ${member.username}` : "No member assigned"}
              </Text>
              <DelectButton />
          </Flex>
      </Card><Flex
          justifyContent="space-between" width="100%" padding="10px"
      >
              <Flex align="center">
                  <Text>
                      Stay
                  </Text>
              </Flex>

              <Box
                  display="flex"
                  width="auto"
                  alignItems="center"
                  flexGrow={1}
              >
                  <StayMenuItem to="/">Home</StayMenuItem>
                  <StayMenuItem to="/about">About</StayMenuItem>
                  <StayMenuItem to="/contact" isLast>Contact</StayMenuItem>
              </Box>
          </Flex></>
  );
};

export default Stay;
